import * as React from 'react';

import { Typography, Divider } from '@material-ui/core';
import { Fade, Reveal } from 'react-reveal';

import Graduation from '../images/grad.jpg';

const Landing = (props) => {
  return (
    <div className='landing'>
        <Divider variant="middle" classes={{ root: props.classes.divider }} />
      <div className='grid-2-h'>
        <Fade left className='about-me'>
          <Typography variant='h3'>About me</Typography>
          <Typography variant='body1'>Hi, my name is John,(Populate with text describing me)</Typography>
        </Fade>
        <Fade right className='landing-image-container'>
          <img className='landing-image' src={Graduation} alt='High School Graduation' />
        </Fade>
      </div>
    </div>
  );
}
export default Landing;
